PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE historical_prices (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            metal TEXT NOT NULL,
            date DATE NOT NULL,
            open_price REAL NOT NULL,
            high_price REAL NOT NULL,
            low_price REAL NOT NULL,
            close_price REAL NOT NULL,
            volume INTEGER,
            daily_change_pct REAL,
            is_limit_up BOOLEAN DEFAULT 0,
            is_limit_down BOOLEAN DEFAULT 0,
            cycle_name TEXT NOT NULL,
            cycle_start_date DATE NOT NULL,
            days_from_start INTEGER NOT NULL,
            weeks_from_start INTEGER NOT NULL,
            created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
            UNIQUE(metal, date, cycle_name)
        );
CREATE TABLE current_prices (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            metal TEXT NOT NULL,
            date DATE NOT NULL,
            open_price REAL NOT NULL,
            high_price REAL NOT NULL,
            low_price REAL NOT NULL,
            close_price REAL NOT NULL,
            volume INTEGER,
            daily_change_pct REAL,
            is_limit_up BOOLEAN DEFAULT 0,
            is_limit_down BOOLEAN DEFAULT 0,
            cycle_start_date DATE NOT NULL,
            days_from_start INTEGER NOT NULL,
            weeks_from_start INTEGER NOT NULL,
            created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
            updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
            UNIQUE(metal, date)
        );
CREATE TABLE weekly_aggregates (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            metal TEXT NOT NULL,
            cycle_name TEXT NOT NULL,
            week_start_date DATE NOT NULL,
            weeks_from_start INTEGER NOT NULL,
            open_price REAL NOT NULL,
            close_price REAL NOT NULL,
            high_price REAL NOT NULL,
            low_price REAL NOT NULL,
            weekly_change_pct REAL NOT NULL,
            cycle_change_pct REAL NOT NULL,
            limit_up_days INTEGER DEFAULT 0,
            limit_down_days INTEGER DEFAULT 0,
            total_trading_days INTEGER DEFAULT 0,
            volatility_indicator TEXT, -- 'normal', 'volatile', 'high_volatility'
            created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
            updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP, week_over_week_pct REAL,
            UNIQUE(metal, cycle_name, weeks_from_start)
        );
CREATE TABLE market_cycles (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            cycle_name TEXT UNIQUE NOT NULL,
            metal TEXT NOT NULL,
            start_date DATE NOT NULL,
            end_date DATE,
            start_price REAL NOT NULL,
            end_price REAL,
            peak_price REAL,
            peak_date DATE,
            total_return_pct REAL,
            duration_days INTEGER,
            duration_weeks INTEGER,
            is_historical BOOLEAN DEFAULT 0,
            description TEXT,
            created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
        );
CREATE TABLE data_sources (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            source_name TEXT UNIQUE NOT NULL,
            api_url TEXT,
            api_key_required BOOLEAN DEFAULT 0,
            rate_limit_per_minute INTEGER,
            last_fetch_time TIMESTAMP,
            is_active BOOLEAN DEFAULT 1,
            created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
        );
DELETE FROM sqlite_sequence;
CREATE INDEX idx_historical_metal_date ON historical_prices(metal, date);
CREATE INDEX idx_historical_cycle ON historical_prices(cycle_name, weeks_from_start);
CREATE INDEX idx_current_metal_date ON current_prices(metal, date);
CREATE INDEX idx_weekly_cycle ON weekly_aggregates(metal, cycle_name, weeks_from_start);
COMMIT;
